import React from "react";


const SlotM = (props) =>{
    // let x = 'smile';
    // let y = 'smile';
    // let z = 'weep';
  
    // let x = props.x;
    // let y = props.y;
    // let z = props.z;
  
    if((props.x===props.y) && (props.y===props.z)){
            return(
              <>
              <div className="slot_inner">
                <h1> {props.x} {props.y} {props.z}</h1>
                <h1>This is matching</h1>
                <br />
              </div>
              </>
            );
    }
  
    else{
      return(
        <>
        <div className="slot_inner">
          <h1> {props.x} {props.y} {props.z}</h1>
          <h1>This is not matching</h1>
          <br />
        </div>
        </>
      );
    }
  }

  export default SlotM;
